\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1921086","type":"CustomJS"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"1920738"}},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"1920929","type":"Scatter"},{"attributes":{},"id":"1920709","type":"LinearScale"},{"attributes":{"source":{"id":"1920837"}},"id":"1920842","type":"CDSView"},{"attributes":{"line_alpha":{"value":0.2},"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"1920987","type":"Segment"},{"attributes":{"below":[{"id":"1920751"}],"center":[{"id":"1920754"},{"id":"1920758"},{"id":"1920812"}],"height":110,"left":[{"id":"1920755"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"1920780"},{"id":"1920786"},{"id":"1920796"},{"id":"1920818"},{"id":"1920841"},{"id":"1920866"}],"sizing_mode":"stretch_width","title":{"id":"1920798"},"toolbar":{"id":"1920767"},"toolbar_location":null,"width":null,"x_range":{"id":"1920702"},"x_scale":{"i
